uses crt;

type

  element = record
      num:integer;
      name:string[10];
  end;

  List=^Node;
  Node=record
    info:element;
    next,prev:List;
  end;

var
  head,tail,after : List;
  position:integer;
  info:element;
  ch:char;
   procedure AddFirst(var head,tail : List; info:element);
var
add:List;
begin
      new(add);
      add^.next := nil;
      add^.prev := nil;
      add^.info.name := info.name;
      add^.info.num := info.num;

      if head = nil then
      begin
          head := add;
          tail := add;
      end
      else
      begin
          add^.next := head;
          head^.prev := add;
          head := add;
      end;
end;


procedure AddLast(var head,tail:List;info:element);
begin
      if head = nil then
      begin

          AddFirst(head,tail,info);
      end
      else
      begin
        new(tail^.next);
        tail^.next^.prev:=tail;
        tail:=tail^.next;
        tail^.next:=nil;
      end;
tail^.info:=info;
      tail^.info.name := info.name;
      tail^.info.num := info.num;
end;



procedure InsertSort(var head,tail : List);
var
 save:element;
 indexForInsert,h,t:List;
begin

    h := head;
    t := tail;
    while h^.next <> nil do
    begin

        indexForInsert := h^.next;
        save := indexForInsert^.info;

        t := h^.next;;
        while t^.prev <> nil do

        begin
            if (save.num > t^.prev^.info.num) then
            begin


                t^.info.name := (t^.prev)^.info.name;
                t^.info.num := (t^.prev)^.info.num;
                indexForInsert := indexForInsert^.prev;
            end;

            t:=t^.prev;
        end;
        indexForInsert^.info.name := save.name;
        indexForInsert^.info.num := save.num;

        h := h^.next;
    end;

end;


procedure fileToList(fileName:string;var head,tail : List);
var
f:text;
data:element;
begin
      assign(f,filename);
      reset(f);

      while(not eof(f)) do
      begin
            read(f,data.num);
            readln(f,data.name);
            AddLast(head,tail,data);
      end;
      close(f);


end;

procedure listToFile(fileName:string; head,tail : List);
var
f:text;
data:element;
begin
      assign(f,filename);
      rewrite(f);

      if head=nil then
      begin
        writeln('Spisok pust.');
