          writeln;
          ch:=readkey;
          case ch of
            '1':begin
                    clrscr;
                    writeln;
                    writeln;

                    fileToList('inputEx3.txt',head,tail);


                end;
            '2':begin
                    InsertSort(head,tail);

                end;
            '3':begin
                    clrscr;
                    writeln;
                    writeln;
                    listToFile('inputEx3_.txt',head,tail);

                end;

           end;
      until ch='4';
End.

