/*
Allow gift givers to checkout more than once. If the gift level does not have an expiration date, the Levels page will show the text
"Your Level" and disable the checkout, disallowing any additional gift giver purchases. The code below overrides that behavior, 
allowing the gift giver to repurchase multiple times. Also changes the button text from "Renew" to "Purchase Gift".

*/

function my_pmpro_is_level_expiring_soon($r, $level)
{
	if($level->id == 5)
		$r = true;

	return $r;
}
add_filter('pmpro_is_level_expiring_soon', 'my_pmpro_is_level_expiring_soon', 10, 2);

function my_gettext( $translated_text, $untranslated_text, $domain )
{
	global $pmpro_pages, $post;

	if($untranslated_text == "Renew" && pmpro_hasMembershipLevel(5) && $post->ID == $pmpro_pages['levels'])
	{
		$translated_text = 'Purchase Gift';
	}

   return $translated_text;
}

add_filter('gettext', 'my_gettext', 10, 3);
